import axios from 'axios';
import {primeumType} from "../@types/tour";
import {calculateInsAge} from "../utils/common";

interface primenumTypeInterFace extends primeumType {
    
}

export const getAmt = async (params : primeumType) => {
    let age = calculateInsAge(params.birth);
    console.log(age);
    try {
        const res =  await axios.post('http://43.200.21.215:5000/api/join/primeumCalc',params, {
            validateStatus: () =>  false,
        })
        return res.data.amt.toString().replace(/\B(?<!\.\d*)(?=(\d{3})+(?!\d))/g, ',');

    }catch(e) {
        console.log(e);
        return { data: [] };
    }
}
